import React from 'react';

import './Layout.css';
import Aux from '../Auxillary/Auxillary';
import Toolbar from '../../components/Navigation/Toolbar/Toolbar';

const Layout = (props) => {
  return (
    <Aux>
      <Toolbar />
      <main>{props.children}</main>
      TODO: footer
    </Aux>
  );
};

export default Layout;
